import React from "react";
import { Field, reduxForm, Form } from "redux-form";
import { Button } from "reactstrap";

let LoginForm = props => {
  const { handleSubmit } = props;
  return (
    <Form onSubmit={handleSubmit}>
    <div>
        <label>Email</label>
        <div>
      <Field placeholder="your email" component="input" name="loginId" type="email" /> </div></div>
      <div>
        <label>Email</label>
        <div>
      <Field placeholder="your password" component="input" name="loginPass" type="password" /> </div></div>
      <div>
      <Button type="submit">Login</Button>
     </div>
    </Form>
  );
};

LoginForm = reduxForm({
  form: "login"
})(LoginForm);

export default LoginForm;
